INSERT INTO `qyc_article` VALUES ('4', 'DAY 1  - 首日游玩', '<p>&nbsp; &nbsp; 生态园已建成六大服务区，即仿古式大门游览区、游客住宿活动区、餐饮服务及会议文体活动区、水上娱乐区、动、植物观赏区、冰雪运动区。四季生态园位于吉林省梅河口市东南部，生态环境保持完好，绿地覆盖率达98%以上，境内常年积水，形成5个天然环山湖，珍奇野生动植物非常丰富。园内有仿古式植物长廊2处，养殖湖4个，荷花湖1个，24万棵野山参种植厂1处，果园基地1处。园中基础设施完备，有招待所一栋，餐厅一栋，水上歌舞厅一个，中、小会议室各一个。是游人垂钓和泛舟游览的好地方。生态园树木繁茂，植被优良，景色优美，清雅宜人，山湖倒影，宛如仙境，是休闲、观光、旅游、度假、举办各种会议、音乐会、联谊会，欣赏四季美景的最佳去处。</p>', '首日：首日狂欢派对来袭，更多会员特权活动精彩无限，快定制属于你自己的行程吧！', '0', '1', '1', '#CC3399', '0', '0', '', '1', '1', 'Day 01', '4', '2021-01-11 11:38:31', '2021-01-11 14:08:49');
INSERT INTO `qyc_article` VALUES ('5', 'DAY 2  - 第二天游玩', '<p>&nbsp; &nbsp; 生态园已建成六大服务区，即仿古式大门游览区、游客住宿活动区、餐饮服务及会议文体活动区、水上娱乐区、动、植物观赏区、冰雪运动区。四季生态园位于吉林省梅河口市东南部，生态环境保持完好，绿地覆盖率达98%以上，境内常年积水，形成5个天然环山湖，珍奇野生动植物非常丰富。园内有仿古式植物长廊2处，养殖湖4个，荷花湖1个，24万棵野山参种植厂1处，果园基地1处。园中基础设施完备，有招待所一栋，餐厅一栋，水上歌舞厅一个，中、小会议室各一个。是游人垂钓和泛舟游览的好地方。生态园树木繁茂，植被优良，景色优美，清雅宜人，山湖倒影，宛如仙境，是休闲、观光、旅游、度假、举办各种会议、音乐会、联谊会，欣赏四季美景的最佳去处。</p>', '首日：首日狂欢派对来袭，更多会员特权活动精彩无限，快定制属于你自己的行程吧！', '0', '1', '1', '#00FFFF', '0', '0', '', '1', '2', 'Day 01', '3,4', '2021-01-11 11:38:31', '2021-01-11 14:08:38');
INSERT INTO `qyc_article` VALUES ('6', '弯弯小河畔，幽美景色堪比威尼 斯，快来体验吧！', '<p>&nbsp; &nbsp; &nbsp; 欢迎您来到主题乐园，参加美食街活动。主题乐园拥有1832m²大型室内游玩场所。</p><p><br/></p><p>&nbsp; &nbsp; &nbsp; ⭐主题咖乐园融参与性、观赏性、娱乐性、趣味性于一体，绝对的网红打卡圣地⭐致力打造成为中国最新、最具个性魅力的主题乐园，是主题咖度假区的重要组成部分。它根据天然优美的海岸线，自然天成的山水，巧妙地将多种精彩刺激的高科技游乐设备与地中海风格建筑相融合，形成了热情奔放的幸运大道区、惊险刺激的冒险丛林区、神秘诡异的海盗城堡区、梦幻童话的美人鱼湖区、激情四溢的神秘岛区和碧海银滩的加勒比海岸区等六大主题区域，多种高科技游乐项目，带你飞跃翻腾。</p><p><br/></p><p>　　主题咖拥有亚洲第一的&quot;E型战车&quot;；中国第一座&quot;疯狂逃生船&quot;、&quot;云霄飞车&quot;、&quot;垂直极限&quot;等高科技的大型游乐设施，配合多项中小型游乐项目和近10种充满异国风情的表演，让游客在互动中享受刺激与欢乐。</p><p><br/></p>', '欢迎您来到主题乐园，参加美食街活动。主题乐园拥有1832m²大型室内游玩场所', '84', '0', '68', '', '0', '0', '', '1', '0', '', null, '2021-01-12 10:42:48', '2021-02-01 11:19:34');
