INSERT INTO `qyc_article` VALUES ('8', '我能否携带饮料和食物入住？ ', '<p>不需要！不需要！不需要！真的不需要，我们里面的餐饮都是拿来看的嘛？我们辛辛苦苦建立了这一切就是想要你吃喝开心，外面的食品多不健康，万一吃了拉肚子就会错过一个完美的假期了；所以！请你们一定要在餐饮店进行就餐，好吃又不贵，不满足的话你一声客服电话，我们上门为您现场制作。</p>', '', '86', '0', '0', '', '0', '0', '', '1', '0', '', null, '2021-01-12 10:46:18', '2021-01-12 10:46:18');
INSERT INTO `qyc_article` VALUES ('9', '携带药品规定?', '<p>我们建议您日常保持一个棒棒的身体健康，出行健康靠大家！如果真的需要带药品，需要符合国家药品局的药物，禁止携带不良“药品”入内，如需大病药物，酒店内有配备专业医生为您检查及检查您的用药！所以大家尽量保持棒棒的身体哦！</p>', '', '86', '0', '0', '', '0', '0', '', '1', '2', '', null, '2021-01-12 10:46:37', '2021-01-12 10:46:37');
