INSERT INTO `qyc_category` VALUES ('14', '服务使用协议', '', '13', '1', '', '', '2019-08-12 09:22:12', '2021-02-04 11:48:18', '1', '0', null, '<p><strong><span style=\"font-size: 20px;\">《扎西小镇服务协议》</span></strong></p><p><span style=\"font-size: 20px;\"><br/></span></p><p>欢迎你使用扎西小镇小程序！</p><p><br/></p><p>在使用扎西红色小镇提供的各项服务之前，请您仔细阅读并遵守《扎西红色小镇用户服务协议》(以下简称“本协议”)。如果您对本协议的内容有任何疑问，请向客服咨询。当您按照注册页面提示填写信息、阅读并同意本协议且完成全部注册程序后，即表示您已充分阅读、理解并接受本协议的全部内容，并与本网站达成协议。与您的权益有重大关系、涉及免除或限制责任的免责条款。本《协议》条款适用于本网站提供的各种服务，但当某一特定服务另有单独的服务条款、指引或规则时，您应遵守本《协议》条款及本网站随时公布的与该服务相关的服务条款、指引或规则等。前述所有的指引和规则，均构成本《协议》的一部分。在本网站运营期间，我们会根据结合公司实际情况修改服务及其他条款内容，并在第一时间对外发布。在我们变更这些条款后，您对网站购物网的继续使用，视为接受我们的变更行为。如果您不同意本使用交易条款中的任何一条，请您立即停止使用平台所提供的全部服务。如果您未满18周岁，您只能在父母或其他监护人的参与下使用服务。</p><p>&nbsp;</p><p>一、账户</p><p>1、注册成功，成为我们的合法用户，您可以设置个账户和密码。请您对您的注册用户名和密码妥善保管，防止被他人恶意利用。为维护自身权益，您不应将账户及密码泄漏或提供第三者知悉或出借或转让与他人使用，如因您自身过错或过失而导致账户或密码泄漏而给自身造成损失，您应自行承担责任。如您遗失账户或密码，本网站保留就此问题的服务向您索取额外费用的权利。(1)修改密码：如您想修改您的账户密码，则可以根据本网站的操作程序进行更改。(2)忘记密码：如您忘记密码可根据本网站的操作程序进行重置密码。</p><p>2、若您发现账户或密码遭他人非法使用或有异常使用的情形，应立即通知本网站，并提交该账户为本人所有的有关证明，以便申请该账户的暂停使用，因此而造成的损失，本网站不承担任何赔偿责任。根据法律规定申请立案的情况下，本网站有义务协助查询。如因为您的原因，导致订购商品的信息及其它信息外漏，本网站将不承担任何的赔偿责任，本网站会协助您挽回相关损失。</p><p>3、如果您提供的个人信息中有任何一项不正确，致本网站商家不能在正常状态下进行配送，例如：由于您的原因造成订单延迟或无法配送等，本网站及本网站商家将不承担任何赔偿责任。</p><p>4、隐私保护：您的个人资料本网站会妥善保管。本网站从网站上或电话中得到的所有客户信息仅用来处理您的相关订单及相关服务。法律许可要求本网站提供本网站用户相关信息给执法单位，在以下四种情况是必要的</p><p>(1)遵守有关法律规定，遵从本网站合法服务程序；</p><p>(2)保持维护本网站的商标及知识产权的所有权</p><p>(3)在紧急情况下竭力维护用户个人和社会大众的隐私安全；</p><p>(4)符合其他相关的法律法规的要求。</p><p>5、本网站拥有通过邮件、短信、APP消息、电话等形式，向在本网站注册、购物用户、收货人发送订单信息、促销活动等告知信息的权利。</p><p>6、如您连续两年未登录过本站账户，您的账户可能被注销，届时，本站有权终止对您提供服务。</p><p>用户行为规范</p><p>1、您声明并承诺是依据中国法律设立并有效存续的有限责任公司/股份有限公司/其他形式的组织或具有完全民事行为能力的自然人，具有一切必要的权利及能力订立及履行本协议项下的所有义务和责任；本协议一经生效即对您具有法律约束力。</p><p>2、您有权在本网站相应位置发布信息，您承诺并保证提供或发布的所有信息(包括但不限于您的基本资料、项目保密信息等)是真实、准确、完整的，符合中国各项法律、法规及规范性文件以及本网站的相关规则，不存在虚假、误导性陈述或重大遗漏。</p><p>3、您应维护本网站的正常运作及其公信力，不得实施有损于本网站的行为，包括但不限于以下行为：</p><p>(1)、传输或发表损害国家、社会公共利益和涉及国家安全的信息资料或言论，不得发起、参与任何洗钱类项目</p><p>(2)、利用本站从事窃取商业秘密、窃取个人信息等违法犯罪活动。未经本网站书面许可，通过本协议约定方式之外的途径进入本网站或其计算机信息网络系统或者使用本协议约定范围外的信息网络资源或服务；(3)、未经本网站书面许可，对本网站或其计算机信息网络中存储、处理或者传输的数据和应用程序进行删除、修改或者增加</p><p>(4)、采取不正当竞争行为，扰乱网上交易的正常秩序(例如恶意购买等)，从事与网上交易无关的行为故意制作、传播计算机病毒等破坏性程序</p><p>(5)、其他危害计算机信息网络安全、妨碍本网站正常运作、有损其公信力的行为；</p><p>(6)、以虚构或歪曲事实的方式进行违法或不当评价</p><p>(7)、其他有损于本网站的行为。</p><p>4、通过本网站实名认证的注册，您有权在其权限内浏览、发布信息。您承诺并保证妥善保管其在本网站的账号和密码，并对其登录状态中的所有活动和事件承担责任。您若发现任何非法使用其帐号或存在安全漏洞的情况，应立即通知本网站并采取措施以减少不必要的损失</p><p>5、您承诺并保证其提供或发布的信息不存在以下情形</p><p>(1)、违反中国各项法律、法规及规范性文件规定的</p><p>(2)、危害国家安全、泄露国家秘密、颠覆国家政权、破坏国家统一的，煽动民族仇恨、民族歧视，破坏民族团结的，破坏国家宗教政策、宣扬邪教和封建迷信的，有损国家荣誉和利益的；</p><p>(3)、散布谣言、含有淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪信息，扰乱社会秩序，破坏社会稳定的</p><p>(4)、侮辱或者诽谤他人，侵犯其他任何第三方知识产权及其他合法权益的；</p><p>(5)、发布、传送、传播、储存侵害他人名誉权肖像权、知识产权、商业秘密等合法权利的内容；</p><p>(6)、其他含有法律、法规及规范性文件禁止内容的</p><p>6、您通过本网站发布的涉嫌违法或涉嫌侵犯他人合法权利或违反本协议的信息，本网站有权依据其独立判断对该等信息予以修改、编辑或删除，而无需事先通知相关您。您违反上述行为规范对任意第三方造成损害的，您应独立承担由此造成的一切损失和法律责任，并应确保本网站免于承担因此产生任何损失或费用。</p><p>7、您承诺并保证使用本网站服务的风险由其自身承担。其根据自身需求下载或通过本网站产品服务取得相关信息资料，由其自行承担系统受损、资料丢失以及其它任何风险。</p><p>8、请您切记不得在本网站进行任何违反国家法律法规及本网站各项规则的活动，不得在本网站进行任何破坏公共安全的活动，不得在本网站进行任何非法商业活动，不得在本网站进行任何破坏公共秩序的活动，不得利用网站BUG进行任何活动。</p><p>9、您承诺并保证若其违反上述承诺和保证而给本网站造成损失，您同意承担赔偿责任。并且本网站有权关闭您相关权限、暂停账号使用或删除账号。</p><p>三、订单</p><p>1、您的订单将视为您向商家发出订购的要约或申请，而不能证明您和商家之间建立了契约关系。当商家将商品发送至您的指定地址并经您签收确认后，商家和您之间的订购合同成立。如本网站发现商家所发布的商品信息明显错误、缺货、质量、配送问题等，商家无法按照您的订单信息正常配送的情况下，本网站会督促商家通过ema或电话、短信等通知您是否更换其他商品或配送方式。</p><p>2、您所购买的商品在确认下单之后，视为商品最终成交价格，本网站商家发布商品信息及价格、商品说明不构成要约或承诺。本网站任何有关商品说明的内容以商家实际发货的商品实物信息为准，同时，我们将要求监督商家完善商品描述及说明等相关信息。如果您在本网站购买的商品与本网站网站的商品描述不一致，您可以在签收时选择拒收。已签收的商品未经使用且不影响二次销售可根据本网站的服务规则进行商品退换。</p><p>3、发生下列情形之一时，本网站有权停止或中断向您提供的网络服务：</p><p>(1)对于本网站的网络设备进行必要的保养及施工；</p><p>(2)发生突发性的网络设备故障时</p><p>(3)由于本网站所用的网络通信设备由于不明原因停止，无法提供服务时；</p><p>(4)由于不可抗力因素致使本网站无法提供线上网络服务；</p><p>(5)由于相关政府机构的要求。</p><p>4、如果您违反本协议规定而使用(或其他人经您同意后使用)本网站或服务，本网站有权中止您全部或部分使用服务、访问本网站和/或购买服务/商品。</p><p>5、对因如下原因(包括但不限于)造成本网站的所有损失、责任或费用(包括但不限于任何人因如下原因而对我们提起的任何诉求或法律程序等)，您应承担赔偿责任：</p><p>(1)您或您授权的任何人不恰当的使用服务或本网站</p><p>(2)您或您授权的任何人不恰当的使用服务/商品(3)任何人通过您的用户名及密码不恰当的使用服务或本网站；</p><p>(4)您或您授权的任何人违反本协议规定。</p><p>6、本网站严禁商业目的屯货声明</p><p>(1)本网站是一家品牌特卖网站，本网站所服务的客户为以终端消费为目的的个人、企业、事业单位及其他社会团体，不包括经销商、批发商、实体店等群体。本网站严禁经销商、批发商、实体店等群体以商业为目的进行屯货，如发现，本网站将拒绝为其服务。由此产生的一切后果由经销商自行承担。</p><p>(2)如有发现同用户D批量下单，购买的数量过多，将会被本网站列为异常订单，后经本网站确认为异常订单，有权要求商家不予发货。</p><p>四、商品配送</p><p>1、本网站商家将会把商品送到您所指定的收货地址。所有商家在本网站上列出的商品配送时间为参考时间。配送费用根据您选择的配送方式及收货地区的不同而异。请清楚准确地填写您的真实姓名、收货地址及联系方式。因如下情况造成订单延迟或无法配送等，本网站及商家将不承担责任</p><p>(1)客户提供错误信息和不详细的地址</p><p>2)货物送达无人签收，由此造成的重复配送所产生的费用及相关的后果；</p><p>()不可抗力，例如：自然灾害、交通戒严、突发战争等</p><p>五、版权说明</p><p>1、本网站提供的网络服务的著作权、专利权、商标、商业机密及其它权利均归本网站所有。非经本网站的同意，任何人均不得自行下载、复制、传输、改编编辑本网站网站页面等信息，及行使侵犯本网站相关著作权、专利权、商标、商业机密及其它权利的行为，否则本网站将向司法机关提起维权诉讼，并进行追偿。2、您在使用服务过程中获得的任何信息的相关权利、所有权和知识产权为相关信息所有人或销售商的财产，受有关著作权法或其他法律的保护。您在本协议项下不对该等信息享有任何权利。</p><p>3、您向本网站传送、张贴或提交的任何材料应被视为非保密和非专有信息；您已向我们披露或提供的或我们对关于服务或询价而回复的所有意见、建议、想法、记录、图纸、概念或其他信息(统称为“构想)应被视为属于本网站的财产，您在此同意将构想中现有或将来取得的知识产权全部转让给网站。在任何情况下，构想无需以保密方式提交，且网站不因对构想予以利用而承担任何明示的或默示的义务。此外，我们对任何构想的全部权利在全球范围内享有排他性使用权，且有权不受限制地将构想用于商业或其他目的，而无需向构想的提供方支付任何代价。</p><p>争议解决</p><p>1、我们有义务在技术上确保网站的正常运行，尽力避免服务中断或将中断时间限制在最短时间内，保证用户在本网站交易活动的顺利进行。但如因不可抗力或其他我们无法控制的原因使网站崩溃或无法正常使用导致网站上交易无法完成或丢失有关的信息、记录等，本网站不承担任何赔偿责任。</p><p>七、责任限制</p><p>1、本网站对任何直接、间接、偶然、特殊及继起的损害不承担赔偿责任，这些损害可能来自：不正当使用网络服务，非法使用网络服务或用户传送的信息有所变动等。</p><p>2、在本协议约定的情形下，除了本网站的相关规则中规定的其它限制和除外情况之外，在中国法律法规所允许的限度内，对于因交易而引起的或与之有关的任何直接的、间接的、特殊的、附带的、后果性的或惩罚性的损害，或任何其它性质的损害，本网站的全部责任，不论是合同、保证、侵权(包括过失)项下的还是其它的责任，均不超过您所购买的与该索赔有关的商品价值额。八、争议处理</p><p>1、如果您在本网站购物时与商家产生争议，将按照与本网站签订的购物协议及相关法律有司法部门进行裁决</p><p>九、承诺</p><p>1、本网站承诺监督所有商家秉承质优价低、让您放心满意的购物理念为您服务。</p><p>2、本网站承诺监督所有商家销售正品行货，本网站用户享有国家正规三包政策购物保障。</p><p>十、注意条款</p><p>1、资料填写：为确保交易的正常进行，您必须向我们提供真实、有效的个人信息，如果您的个人信息有所变动，请及时登录本网站网站进行修改或致电客服热线，以便您能够及时的收到订单商品。</p><p>2、除本《协议》明确规定或中国法律另有规定本网站向您所提供的网络服务，不负任何明示或默示的担保责任，所提供的网络服务的稳定、安全、无误及不中断性亦有可能因不可抗力等情形而受到影响。您应自行承担使用网络服务所产生的所有风险及因此可能导致的损害</p><p>3、本网站对其网络服务不保证不出现任何程序BUG或程序漏洞，并对由此可能产生的问题不承担任何赔偿责任。</p><p>4、您理解并且同意：您通过本网站网站向商家订购商品或服务过程中出现争议、纠纷时，由您跟商家自行协商处理。本网站网站有权(但非义务)选择是否介入争议处理，但该等争议原则上与本网站网站无关。</p><p><br/></p>', '2', '', '1', '', '1', '2');
INSERT INTO `qyc_category` VALUES ('15', '隐私政策', '', '13', '2', '', '', '0000-00-00 00:00:00', '2020-12-31 16:01:50', '1', '0', null, '<p><strong><span style=\"font-size: 20px;\">《扎西小镇隐私政策》</span></strong></p><p><br/></p><p>亲爱的本网站用户，本网站将按法律法规要求，采取相应安全保护措施，尽力保护您的个人信息安全可控。故本网站制定本《隐私政策》(以下或称本政策)并提醒您：本政策适用于本网站商品或服务需要特别说明的是，本政策不适用于其他第三方向您提供的服务。例如本网站上的商家及第三方服务商依托本网站向您提供服务时，您向商家及第三方服务商提供的人信息不适用本政策。</p><p>在使用本网站各项商品或服务前，请您务必仔细阅读并透彻理解本政策，在确认充分理解并同意后使用相关商品或服务。一旦您开始使用本网站各项商品或服务，即表示您已充分理解并同意本政策。如对本政策内容有任何疑问、意见或建议，您可通过本网站客服与本网站联系。</p><p>一、定义</p><p>本网站：指本网站服务提供者运营的本网站APP。</p><p>个人信息：指以电子或者其他方式记录的能够单独或者与其他信息结合识别特定自然人身份或者反映特定自然人活动情况的各种信息。</p><p>个人敏感信息：包括身份证件号码、个人生物识别信息、银行账号、财产信息、行踪轨迹、交易信息、14岁以下(含)儿童的个人信息等。</p><p>个人信息删除：指在实现日常业务功能所涉及的系统中去除个人信息的行为，使其保持不可被检索、访问的状态。</p><p>二、隐私政策的内容</p><p>本网站如何收集和使用您的个人信息</p><p>本网站如何使用 Cookie和同类技术</p><p>本网站如何共享、转让、公开披露您的个人信息</p><p>本网站如何保护您的个人信息安全</p><p>您如何管理个人信息</p><p>未成年人信息的保护</p><p>通知和修订</p><p>如何联系本网站</p><p>1、本网站如何收集和使用您的信息</p><p>(1)帮助您成为本网站的会员</p><p>您通过在本网站平台申请并成为本网站的会员，本网站将为您提供会员服务，您需要创建本网站平台账户，提供手机号码和拟使用的会员名和密码。如果您仅需使用浏览、搜索等基本服务，您不需要注册成为本网站的会员及提供上述信息。</p><p>如果您提供真实姓名、性别、出生年月日、居住地、头像等额外的个人资料，本网站可以为您提供生日特权等更加个性化的会员服务。但这些信息的提供与否，不影响您使用本网站的基本浏览、搜索、购买功能。</p><p>对于您使用的所有需要本网站平台账户的服务，本网站都可能会使用您提供上述信息，以确保您在本网站的所有服务中使用同一个会员身份。</p><p>如果您已拥有本网站平台账户，本网站可能会在本网站平台服务中显示您的上述个人信息以及您在本网站平台上或与本网站平台账户相关联的商品和服务中执行的操作，例如通过本网站平台账户集中展示您的个人资料或交易订单。本网站会尊重您对本网站平台服务和本网站平台账户设置所做的选择。</p><p>(2)为您展示和推送商品或服务</p><p>为改善本网站的商品或服务、向您提供个性化的信息搜索及交易服务，本网站会根据您的浏览及搜索记录、设备信息、位置信息、订单信息，提取您的浏览、搜索偏好、行为习惯、位置信息等特征，基于特征标签进行间接人群画像并展示、推送信息及其他不针对您个人兴趣爱好等特征的选项商品或服务。</p><p>如果您不想接受本网站给您发送的商业广告，您可通过短信提示回复退订或本网站提供的其他方式进行退订。</p><p>(3) 向您提供商品或服务</p><p>您向本网站提供的信息</p><p>为便于向您提供本网站的商品或服务，本网站会记录您提供的收货人姓名、收货地址、邮政编码、收货人联系电话。</p><p>为完成交易，您可能需要提供付款账号并选择付款方式，以便本网站了解您的支付状态。</p><p>您可以通过本网站为其他人订购商品或服务或要求其他人帮您付款，您需要提供该实际订购人的前述个人信息或提供代付人的付款账号或手机号码。向本网站提供这些个人信息之前，您需确保您已经取得其授权同意。本网站在您使用服务过程中收集的信息</p><p>为向您提供更契合您需求的页面展示和搜索结果、了解商品适配性、识别账户异常状态，本网站会收集关于您使用的服务以及使用方式的信息并将这些信息进行关联，这些信息包括</p><p>设备信息：本网站会根据您在软件安装及使用中授予的具体权限，接收并记录您所使用的设备相关信息(例如设备型号、操作系统版本、设备设置、唯一设备标识符等软硬件特征和设备环境信息)、设备所在位置相关信息(例如P地址、GPS位置以及能够提供相关信息的W-fi接入点、蓝牙和基站等传感器信息)。</p><p>日志信息：当您使用本网站的网站或客户端提供的商品或服务时，本网站会自动收集您对本网站服务的详细使用情况，作为有关网络日志保存。例如您的搜索查询内容、IP地址、浏览器的类型、电信运营商、使用的语言、访问日期和时间及您访问的网页记录等。</p><p>请注意，单独的设备信息、日志信息等是无法识别特定自然人身份的信息。如果本网站将这类非个人信息与其他信息结合用于识别特定自然人身份，或者将其与个人信息结合使用，则在结合使用期间，这类非个人信息将被视为个人信息，除取得您授权或法律法规另有规定外，本网站会将该类个人信息做匿名化、去标识化处理。</p><p>为展示您账户的订单信息，本网站会收集您在使用本网站服务过程中产生的订单信息用于向您展示及便于您对订单进行管理。</p><p>当您与本网站联系时，本网站可能会保存您的通信/通话记录和内容或您留下的联系方式等信息，以便与您联系或帮助您解决问题，或记录相关问题的处理方案及结果。</p><p>本网站通过间接获得方式收集到的您的个人信息</p><p>为确认交易状态及为您提供售后与争议解决服务，本网站会通过您基于交易所选择的交易对象、交易方式、支付机构、物流公司等收集与交易进度相关的您的交易、支付、物流信息，或将您的交易信息共享给上述服务提供者。</p><p>(4)为您提供安全保障</p><p>为提高您使用本网站提供服务的安全性，保护您或其他用户或公众的人身财产安全免遭侵害，更好地预防钓鱼网站、欺诈、网络漏洞、计算机病毒、网络攻击、网络侵入等安全风险，更准确地识别违反法律法规或本网站相关协议规则的情况，本网站可能使用或整合您的会员信息、交易信息、设备信息、有关网络日志以及本网站关联公司、合作伙伴取得您授权或依据法律共享的信息，来综合判断您账户及交易风险、进行身份验证、检测及防范安全事件，并依法采取必要的记录、审计、分析、处置措施。</p><p>(五)其他用途</p><p>本网站将信息用于本政策未载明的其他用途，或者将基于特定目的收集而来的信息用于其他目的时，会事先征求您的同意。</p><p>(六)征得授权同意的例外</p><p>根据相关法律法规规定，以下情形中收集您的个人信息无需征得您的授权同意</p><p>1、与国家安全、国防安全有关的；</p><p>2、与公共安全、公共卫生、重大公共利益有关的；</p><p>3、与犯罪侦查、起诉、审判和判决执行等有关的；</p><p>4、出于维护个人信息主体或其他个人的生命、财产等重大合法权益但又很难得到您本人同意的</p><p>5、所收集的个人信息是您自行向社会公众公开的；</p><p>6、从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道</p><p>7、根据您的要求签订合同所必需的；</p><p>8、用于维护所提供的商品或服务的安全稳定运行所必需的，例如发现、处置商品或服务的故障；</p><p>9、为合法的新闻报道所必需的；</p><p>10、学术研究机构基于公共利益开展统计或学术研究所必要，且对外提供学术研究或描述的结果时，对结果中所包含的个人信息进行去标识化处理的；</p><p>11、法律法规规定的其他情形。</p><p>如本网站停止运营商品或服务，本网站将及时停止继续收集您个人信息的活动，将停止运营的通知以逐一送达或公告的形式通知您，对所持有的个人信息进行删除或匿名化处理。</p><p>本网站如何使用 Cookie和同类技术</p><p>(一) Cookie</p><p>为确保网站正常运转、为您获得更轻松的访问体验、向您推荐您可能感兴趣的内容及其他内容，本网站</p><p>会在您的计算机或移动设备上存储名 Cookie、 Flash Cookie或浏览器或关联应用程序提供的其他通常包含标识符、站点名称以及一些号码和字符的本地存储(统称 Cookie&quot;)。借助于 Cookie,网站能够存储您的偏好或购物车内的商品等数据。</p><p>如果您的浏览器或浏览器附加服务允许，您可修改对 Cookie的接受程度或拒绝本网站的 Cookie。但如果您这么做，在某些情况下可能会影响您安全访问本网站的网站，且可能需要在每一次访问本网站的网站时更改用户设置。</p><p>(二)网站信标和像素标签</p><p>除 Cookie外，本网站还会在网站上使用网站信标和像素标签等其他同类技术。例如，本网站向您发送的电子邮件可能含有链接至本网站网站内容的地址链接，如果您点击该链接，本网站则会跟踪此次点击，帮助本网站了解您的商品或服务偏好以便于本网站主动改善客户服务体验。网站信标通常是一种嵌入到网站或电子邮件中的透明图像。借助于电子邮件中的像素标签，本网站能够获知电子邮件是否被打开。如果您不希望自己的活动以这种方式被追踪，则可以随时退订。</p><p>本网站如何共享、转让、公开披露您的个人信息</p><p>(一)共享</p><p>本网站不会与本网站服务提供者以外的公司、组织和个人共享您的个人信息，但以下情况除外</p><p>1、在您主动选择情况下共享：若您主动通过本网站购买商品和服务，本网站会根据您的选择，将您的订单信息与交易有关的必要信息与相关商品和服务的提供者共享来实现您向其购买商品或服务的需求，并促使其可以完成后续的售后服务。您可以在相关商品和服务的提供者从事经营活动的主页面查询其营业执照登载的信息或者其营业执照的电子链接标识，以辨别您的交易对象身份。</p><p>2、在获取明确同意情况下共享：获得您的明确同意后本网站会与其他方共享您的个人信息。例如，如果本网站委托第三方向您提供商品或服务时，本网站会在征得您同意后将上述信息共享给第三方，如果您拒绝提供此类信息，本网站将无法完成相关交付服务。</p><p>3、在法定情形下共享：本网站可能会根据法律法规规定、诉讼争议解决需要，或按行政、司法机关依法提出的要求，对外共享您的个人信息。</p><p>4、与授权合作伙伴共享：本网站会委托授权合作伙伴为您提供某些服务或代表本网站履行职能，本网站仅会出于合法、正当、必要、特定、明确的目的共享您的信息，授权合作伙伴只能接触到为其履行职责所需信息且不能将此信息用于任何其他目的。</p><p>目前，本网站的授权合作伙伴包括以下类型</p><p>(1)广告、分析服务类的授权合作伙伴。除非得到您的许可，否则本网站不会将您的个人身份信息(指可以识别您身份的信息，例如姓名或电子邮箱，通过这些信息隐私政策</p><p>可以联系到您或识别您的身份)与提供广告、分析服务的合作伙伴共享。本网站会向这些合作伙伴提供有关其广告覆盖面和有效性的信息，而不会提供您的个人身份信息，或者本网站将这些信息进行汇总，以便它不会识别您个人。例如，只有在广告主同意遵守本网站的广告发布准则后，本网站才可能会告诉广告主他们广告的效果如何，或者有多少人看了他们广告或在看到广告后安装了应用，或者向这些合作伙伴提供不能识别个人身份的统计信息(例如“女性，30-45岁，位于厦门”)，帮助他们了解其受众或客户。</p><p>(2)供应商、服务提供商和其他合作伙伴。本网站将信息发送给支持本网站业务的供应商、服务提供商和其他合作伙伴，这些支持包括提供技术基础设施服务、分析本网站服务的使用方式、衡量广告和服务的有效性、提供客户服务、支付便利或进行学术研究和调查。</p><p>对本网站与之共享个人信息的公司、组织和个人，本网站会与其签署严格的数据保护协议，要求他们按照本网站的说明、本隐私政策以及其他任何相关的保密和安全措施来处理个人信息。</p><p>(二)转让</p><p>本网站不会将您的个人信息转让给任何公司、组织和人，但以下情况除外</p><p>1、在获取明确同意的情况下转让：获得您的明确同意后，本网站会向其他方转让您的个人信息。</p><p>2、在本网站服务提供者发生合并、收购或破产清算情形，或其他涉及合并、收购或破产清算情形时，如涉及到个人信息转让，本网站会要求新的持有您个人信息的公司、组织继续受本政策的约束，否则本网站将要求该公司、组织和个人重新向您征求授权同意。</p><p>(三)公开披露</p><p>本网站仅会在以下情况下，公开披露您的个人信息</p><p>1、获得您明确同意或基于您的主动选择，本网站可能会公开披露您的个人信息</p><p>2、如果本网站确定您出现违反法律法规或严重违反本网站相关协议规则的情况，或为保护本网站及其关联公司用户或公众的人身财产安全免遭侵害，本网站可能依据法律法规或本网站相关协议规则征得您同意的情况下披露关于您的个人信息，包括相关违规行为以及本网站已对您采取的措施。例如，若您销售假货而严重违反本网站规则，本网站可能会公开披露您的店铺主体信息与处罚情况。</p><p>(四)共享、转让、公开披露个人信息时事先征得授权同意的例外</p><p>以下情形中，共享、转让、公开披露您的个人信息无需事先征得您的授权同意</p><p>1、与国家安全、国防安全有关的；</p><p>2、与公共安全、公共卫生、重大公共利益有关的</p><p>3、与犯罪侦查、起诉、审判和判决执行等有关的；</p><p>4、出于维护您或其他个人的生命、财产等重大合法权益但又很难得到本人同意的；</p><p>5、您自行向社会公众公开的个人信息；</p><p>6、从合法公开披露的信息中收集个人信息的，如合法的新闻报道、政府信息公开等渠道。</p><p>根据法律规定，共享、转让经去标识化处理的个人信息，且确保数据接收方无法复原并重新识别个人信息主体的，不属于个人信息的对外共享、转让及公开披露行为，对此类数据的保存及处理将无需另行向您通知并征得您的同意。</p><p>四、本网站如何保护您的个人信息安全</p><p>(一)本网站已采取符合业界标准、合理可行的安全防护措施保护您提供的个人信息安全，防止个人信息遭到未经授权访问、公开披露、使用、修改、损坏或丢失。本网站会使用加密技术提高个人信息的安全性；本网站会使用受信赖的保护机制防止个人信息遭到恶意攻击本网站会部署访问控制机制，尽力确保只有授权人员才可访问个人信息；以及本网站会举办安全和隐私保护培训课程，加强员工对于保护个人信息重要性的认识。(二)本网站有行业先进的以数据为核心，围绕数据生命周期进行的数据安全管理体系，从组织建设、制度设计、人员管理、商品技术等方面多维度提升整个系统的安全性。</p><p>(三)本网站会采取合理可行的措施，尽力避免收集无关的个人信息。本网站只会在达成本政策所述目的所需的期限内保留您的个人信息，除非需要延长保留期或受到法律的允许。</p><p>(四)互联网并非绝对安全的环境，本网站强烈建议您不要使用非本网站推荐的通信方式发送个人信息。您可以通过本网站的服务建立联系和相互分享。当您通过本网站的服务创建交流、交易或分享时，您可以自主选择沟通、交易或分享的对象，作为能够看到您的交易内容、联络方式、交流信息或分享内容等相关信息的第三方。</p><p>在使用本网站服务进行网上交易时，您不可避免地要向交易对方或潜在的交易对方披露自己的个人信息，如联络方式或联系地址。请您妥善保护自己的个人信息，仅在必要的情形下向他人提供。如您发现自己的个人信息尤其是您的账户信息发生泄露，请您立即联络本网站客，以便本网站根据您的申请采取相应措施。</p><p>请注意，您在使用本网站服务时自愿共享甚至公开分享的信息，可能会涉及您或他人的个人信息甚至个人敏感信息，如您在评价时选择上传包含个人信息的图片。请您更加谨慎地考虑，是否在使用本网站的服务时共享甚至公开分享相关信息。</p><p>请使用复杂密码，协助本网站保证您的账号安全。本网站将尽力保障您发送给本网站的任何信息的安全性。如果本网站的物理、技术或管理防护设施遭到破坏，导致信息被非授权访问、公开披露、篡改或毁坏，导致您的合法权益受损，本网站将承担相应的法律责任。</p><p>(五)本网站将不定期更新并公开安全风险、个人信息安全影响评估报告等有关内容，您可通过本网站公告方式获得。</p><p>(六)在不幸发生个人信息安全事件后，本网站将按照法律法规的要求向您告知：安全事件的基本情况和可能的影响、本网站已采取或将要采取的处置措施、您可自主防范和降低风险的建议、对您的补救措施等。事件相关情况本网站将以邮件、信函、电话、推送通知等方式告知您，难以逐一告知个人信息主体时，本网站会采取合理、有效的方式发布公告。</p><p>同时，本网站还将按照监管部门要求，上报个人信息安全事件的处置情况。</p><p>五、您如何管理个人信息</p><p>鉴于本网站使用本网站平台账户为您提供会员服务，因此您可以通过以下方式访问及管理您的个人信息</p><p>(一)访问您的个人信息</p><p>您有权访问您的个人信息，法律法规规定的例外情况除外。您可以通过以下方式自行访问您的个人信息</p><p>账户信息一一如果您希望访问或编辑您的账户中的个人基本资料信息和支付信息、更改您的密码、添加安全信息或关闭您的账户等，您可以在本网站网登录账号通过“账号管理执行此类操作。</p><p>浏览信息一一您可以在本网站网登录账号通过“我的足迹访问或清除您的浏览历史记录。</p><p>订单信息：您可以在本网站网中查阅或清除您的订单记录、交易记录等。</p><p>如果您无法通过上述路径访问该等个人信息，您可以随时通过本网站客服与本网站取得联系。本网站将在15天内回复您的访问请求。</p><p>对于您在使用本网站的商品或服务过程中产生的其他个人信息，本网站将根据本条“(七)响应您的上述请求中的相关安排向您提供。</p><p>(二)更正或补充您的个人信息</p><p>当您发现本网站处理的关于您的个人信息有错误时，您有权要求本网站做出更正或补充。您可以通过“(一)访问您的个人信息中列明的方式提出更正或补充申请。</p><p>（三）删除您的个人信息</p><p>您可以通过“(一)访问您的个人信”中列明的方式删除您的部分个人信息。</p><p>在以下情形中，您可以向本网站提出删除个人信息的请求</p><p>1、如果本网站处理个人信息的行为违反法律法规</p><p>2、如果本网站收集、使用您的个人信息，却未征得您的明确同意；</p><p>3、如果本网站处理个人信息的行为严重违反了与您的约定</p><p>4、如果您不再使用本网站的商品或服务，或您主动注销了账号；</p><p>5、如果本网站永久不再为您提供商品或服务。</p><p>若本网站决定响应您的删除请求，本网站还将同时尽可能通知从本网站处获得您的个人信息的主体，要求其及时删除，除非法律法规另有规定，或这些主体获得您的独立授权。</p><p>当您从本网站的服务中删除信息后，本网站可能不会立即从备份系统中删除相应的信息，但会在备份更新时删除这些信息。</p><p>(四)改变您授权同意的范围</p><p>每个业务功能可能需要一些基本的个人信息才能得以完成(见本隐私政策“第三部分第一条”)。除此之外，对于额外个人信息的收集和使用，您可以在我的本网站账号管理中设置或与本网站客服联系给予或收回您的授权同当您收回同意后，本网站将不再处理相应的个人信息。但您收回同意的决定，不会影响此前基于您的授权而开展的个人信息处理。</p><p>(五)个人信息主体注销账户</p><p>您可以自行在“注销账户页面提交注销申请。</p><p>在您主动注销账户之后，本网站将停止为您提供商品或服务，根据适用法律的要求删除您的个人信息，或使其匿名化处理。</p><p>(六)约束信息系统自动决策</p><p>在某些业务功能中，本网站可能仅依据信息系统、算法等在内的非人工自动决策机制做出决定。如果这些决定显著影响您的合法权益，您有权要求本网站做出解释；</p><p>本网站也将在不侵害本网站商业秘密或其他用户权益社会公共利益的前提下提供申诉方法。</p><p>(七)响应您的上述请求</p><p>本网站将在15天内做出答复。如您不满意，还可以通过本网站客服发起投诉。</p><p>对于您合理的请求，本网站原则上不收取费用，但对多次重复、超出合理限度的请求，本网站将视情收取一定成本费用。对于那些无端重复、需要过多技术手段、给他人合法权益带来风险或者非常不切实际的请求，本网站可能会予以拒绝。</p><p>在以下情形中，按照法律法规要求，本网站将无法响应您的请求</p><p>1、与国家安全、国防安全有关的</p><p>2、与公共安全、公共卫生、重大公共利益有关的</p><p>3、与犯罪侦查、起诉、审判和执行判决等有关的；</p><p>4、有充分证据表明个人信息主体存在主观恶意或滥用权利的；</p><p>5、响应您的请求将导致您或其他个人、组织的合法权益受到严重损害的；</p><p>6、涉及商业秘密的。</p><p>六、未成年人信息的保护</p><p>如果没有父母或监护人的同意，未成年人不得创建自己的用户账户。如您为未成年人的，建议您请您的父母或监护人仔细阅读本隐私政策，并在征得您的父母或监护人同意的前提下使用本网站的服务或向本网站提供信息</p><p>对于经父母或监护人同意使用本网站的商品或服务而收集未成年人个人信息的情况，本网站只会在法律法规允许、父母或监护人明确同意或者保护未成年人所必要的情况下使用、共享、转让或披露此信息。</p><p>七、通知和修订</p><p>本网站的隐私政策可能变更。</p><p>未经您明确同意，本网站不会限制您按照本隐私政策所应享有的权利。</p><p>对于重大变更，本网站会提供更为显著的通知(包括本网站会通过本网站公示的方式进行通知甚至向您提供弹窗提示)。</p><p>本政策所指的重大变更包括但不限于</p><p>1、本网站的服务模式发生重大变化。如处理个人信息的目的、处理的个人信息类型、个人信息的使用方式等2、本网站在控制权等方面发生重大变化。如并购重组等引起的所有者变更等</p><p>3、个人信息共享、转让或公开披露的主要对象发生变化</p><p>4、您参与个人信息处理方面的权利及其行使方式发生重大变化</p><p>5、本网站负责处理个人信息安全的责任部门、联络方式及投诉渠道发生变化时</p><p>6、个人信息安全影响评估报告表明存在高风险时。</p><p>八、如何联系本网站</p><p>您可以通过以下方式与本网站联系，本网站将在15天内回复您的请求：</p><p>1、本网站设立有个人信息保护部门，如对本政策内容有任何疑问、意见或建议，您可联系本网站客服。</p><p>2、如果您对本网站的回复不满意，特别是您认为本网站的个人信息处理行为损害了您的合法权益，您还可以通过向被告住所地有管辖权的法院提起诉讼来寻求解决方案。</p><p><br style=\"white-space: normal;\"/></p><p><br/></p>', '2', '', '1', '', '1', '2');
