INSERT INTO `qyc_category` VALUES ('81', '安全', '', '83', '3', '', '', '2021-01-12 10:11:34', '2021-01-12 10:48:13', '1', '0', null, '<p>消防安全防火十法</p><p>一、要弄熄火柴梗，把烟头掐灭在烟灰缸内，不在酒后或睡前躺在床上或沙发上吸烟。</p><p><br/></p><p>二、要及时关闭电源开关及煤气、液化气总阀门。外出时、临睡前熄灭室内外火种。</p><p><br/></p><p>三、要教育小孩不要玩火、不要玩弄电器设备。</p><p><br/></p><p>四、要在规定区域内安全燃放烟花爆竹。</p><p><br/></p><p>五、要确保走道、楼梯的畅通，不在楼层通道和安全出口处堆物封堵。</p><p><br/></p><p>六、不乱接乱拉电线，防止超负荷用电。使用电加热器时，人不能离开。</p><p><br/></p><p>七、不用明火寻找物品和查漏煤气、液化气。</p><p><br/></p><p>八、不用灯泡取暖或烘烤衣服。</p><p><br/></p><p>九、不把点燃的蚊香贴靠在床沿和窗帘处。</p><p><br/></p><p>十、不在房内焚烧迷信物品。</p><p><br/></p>', '2', '', '1', '', '1', '2');
INSERT INTO `qyc_category` VALUES ('82', '园区介绍', '', '83', '2', '', '', '2021-01-12 10:12:08', '2021-01-12 10:35:37', '1', '0', null, '<p>&nbsp; &nbsp; &nbsp; 欢迎您来到主题乐园，参加美食街活动。主题乐园拥有1832m²大型室内游玩场所。</p><p><br/></p><p>&nbsp; &nbsp; &nbsp; ⭐主题乐园融参与性、观赏性、娱乐性、趣味性于一体，绝对的网红打卡圣地⭐致力打造成为中国最新、最具个性魅力的主题乐园，是主题咖度假区的重要组成部分。它根据天然优美的海岸线，自然天成的山水，巧妙地将多种精彩刺激的高科技游乐设备与地中海风格建筑相融合，形成了热情奔放的幸运大道区、惊险刺激的冒险丛林区、神秘诡异的海盗城堡区、梦幻童话的美人鱼湖区、激情四溢的神秘岛区和碧海银滩的加勒比海岸区等六大主题区域，多种高科技游乐项目，带你飞跃翻腾。</p><p><br/></p><p>　　主题乐园拥有亚洲第一的&quot;E型战车&quot;；中国第一座&quot;疯狂逃生船&quot;、&quot;云霄飞车&quot;、&quot;垂直极限&quot;等高科技的大型游乐设施，配合多项中小型游乐项目和近10种充满异国风情的表演，让游客在互动中享受刺激与欢乐。</p><p><br/></p>', '2', '', '1', '', '1', '2');
