-- ----------------------------
-- Table structure for qyc_china
-- ----------------------------
DROP TABLE IF EXISTS `qyc_china`;
CREATE TABLE `qyc_china` (
  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '地区Id',
  `area_code` varchar(50) NOT NULL COMMENT '地区编码',
  `title` varchar(20) NOT NULL COMMENT '地区名',
  `level` tinyint(4) DEFAULT '-1' COMMENT '地区级别（1:省份province,2:市city,3:区县district,4:街道street）',
  `city_code` varchar(50) DEFAULT NULL COMMENT '城市编码',
  `center` varchar(50) DEFAULT NULL COMMENT '城市中心点（即：经纬度坐标）',
  `pid` int(20) DEFAULT '0' COMMENT '地区父节点',
  `szm` varchar(10) DEFAULT '' COMMENT '首字母',
  `is_hot` tinyint(2) DEFAULT '0' COMMENT '是否热门城市：0不是，1是',
  `manzu_price` decimal(10,2) DEFAULT '0.00' COMMENT '满足金额',
  `send_price` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `update_time` int(12) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  KEY `areaCode` (`area_code`),
  KEY `parentId` (`pid`),
  KEY `level` (`level`),
  KEY `areaName` (`title`)
) ENGINE=InnoDB AUTO_INCREMENT=3260 DEFAULT CHARSET=utf8 COMMENT='地区码表';

