CREATE TABLE `qyc_codes` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `codes` varchar(100) DEFAULT '' COMMENT '商品ID',
  `type` tinyint(2) DEFAULT '1' COMMENT '1月卡，2半年卡，3年卡,4体验卡',
  `days` int(10) DEFAULT '0' COMMENT '对应的有效天数',
  `old_price` decimal(10,2) DEFAULT '0.00' COMMENT '原价',
