  `return_id` int(11) DEFAULT '0' COMMENT '收藏对象id',
  `uid` int(11) DEFAULT '0' COMMENT '用户ID',
  `collect_type` tinyint(2) DEFAULT '0' COMMENT '1商品',
  `add_time` int(11) DEFAULT NULL COMMENT '收藏时间',
