-- ----------------------------
-- Table structure for qyc_comment
-- ----------------------------
DROP TABLE IF EXISTS `qyc_comment`;
CREATE TABLE `qyc_comment` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `pid` int(12) DEFAULT '0' COMMENT '上级id',
  `xt_pid` int(12) DEFAULT '0' COMMENT '顶级id',
  `type` tinyint(2) DEFAULT '1' COMMENT '评论对象：1商品  2课程，3直播，4题库',
  `order_id` int(12) DEFAULT '0' COMMENT '对应类型的订单id',
  `return_id` int(12) DEFAULT '0' COMMENT '评论对象id,(商品、课程等)',
  `uid` int(12) DEFAULT '0' COMMENT '评论人id',
  `reply_uid` int(10) DEFAULT '0' COMMENT '被回复用户id',
  `is_see` tinyint(2) DEFAULT '0' COMMENT '0未读，1已读',
  `content` varchar(250) CHARACTER SET utf8 DEFAULT NULL COMMENT '内容',
  `additional_comment` varchar(250) CHARACTER SET utf8 DEFAULT NULL COMMENT '追评内容',
  `additional_time` int(12) DEFAULT '0' COMMENT '追评时间',
  `imgarr` text CHARACTER SET utf8 COMMENT '图集id逗号拼接',
