  `id` int(12) NOT NULL AUTO_INCREMENT,
  `title` varchar(150) DEFAULT NULL COMMENT '税率标题',
  `area_type` tinyint(2) DEFAULT '1' COMMENT '1商城优惠券',
  `type` tinyint(2) DEFAULT '1' COMMENT '优惠券类型：1现金优惠券，2满折优惠券，3满减优惠券',
  `manzu` decimal(10,2) DEFAULT '0.00' COMMENT '满足金额',
  `val` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券的值',
  `get_type` tinyint(2) DEFAULT '0' COMMENT '领取途径：1无条件赠送,2分享赠送，3,普通用户邀请消费赠送',
  `days` int(5) DEFAULT '0' COMMENT '有效期多少天',
  `end_time` int(12) DEFAULT '0' COMMENT '过期日期',
