  `end_time` int(12) DEFAULT '0' COMMENT '过期时间',
  `get_time` int(12) DEFAULT '0' COMMENT '领取时间',
  `get_date` varchar(30) DEFAULT '' COMMENT '日期',
  `is_use` tinyint(2) DEFAULT '0' COMMENT '使用状态：0未使用，1已使用',
  `use_time` datetime DEFAULT NULL COMMENT '使用时间',
  `user_status` tinyint(2) DEFAULT '1' COMMENT '1正常',
