  `pid` smallint(6) unsigned DEFAULT '0' COMMENT '上级id',
  `icon` varchar(50) DEFAULT '' COMMENT '图标',
  `is_tjposition` tinyint(1) NOT NULL DEFAULT '2' COMMENT '是否开启推荐位：1开启，2关闭',
  `sort` smallint(6) unsigned DEFAULT '99' COMMENT '排序，值越小越靠前',
