  `uid` int(11) DEFAULT NULL COMMENT '用户ID',
  `type` tinyint(2) DEFAULT '1' COMMENT '1手机，2pc',
  `content` varchar(220) DEFAULT NULL COMMENT '消息内容',
  `typeid` int(5) DEFAULT '0' COMMENT '分类id',
  `imgarr` text COMMENT '图集id',
  `username` varchar(100) DEFAULT '' COMMENT '姓名',
  `mobile` varchar(50) DEFAULT '' COMMENT '电话',
  `create_time` int(12) DEFAULT '0' COMMENT '发送时间',
  `status` int(2) DEFAULT '1' COMMENT '状态',
  `check_status` tinyint(2) DEFAULT '0' COMMENT '0未处理，1已处理',
  `check_reason` varchar(200) DEFAULT '' COMMENT '处理意见',
  `check_time` int(12) DEFAULT '0' COMMENT '处理时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

