DROP TABLE IF EXISTS `qyc_flowater`;
CREATE TABLE `qyc_flowater` (
  `id` int(20) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `uid` int(12) NOT NULL DEFAULT '0' COMMENT '用户id,0平台',
  `pt_type` tinyint(2) DEFAULT '1' COMMENT '1用户，2平台',
  `type` tinyint(2) NOT NULL DEFAULT '1' COMMENT '1收入，2支出',
  `zf_type` tinyint(2) DEFAULT '0' COMMENT '1购买商品，2余额退回(取消、超时未付)，3退款退回,4余额充值,5提现',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付的金额',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '余额',
  `create_time` int(12) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `update_time` int(12) DEFAULT '0' COMMENT '修改日期',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `remark` varchar(250) DEFAULT NULL COMMENT '备注',
  `return_id` int(10) DEFAULT '0' COMMENT '对应的关联id(zf_type:1,2时关联对应订单id)',
  `return_uid` int(10) DEFAULT '0' COMMENT '关联的用户(例我的邀请人id,平台提现用户id)',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='会员浏览信息表';

