  `free_status` tinyint(2) DEFAULT '1' COMMENT '收费状态：1所有人免费，2购买课程人免费，3所有人收费',
  `new_price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `is_lb` tinyint(1) NOT NULL DEFAULT '2' COMMENT '是否录制: 1录制 2不录制',
  `room_number` varchar(255) NOT NULL DEFAULT '' COMMENT '房间编号',
  `look_num` int(11) NOT NULL DEFAULT '0' COMMENT '观看人数',
  `open_date` varchar(30) DEFAULT '' COMMENT '开播日期',
  `start_time` varchar(30) NOT NULL DEFAULT '' COMMENT '开播时间',
  `over_time` varchar(30) NOT NULL DEFAULT '' COMMENT '结束时间',
  `flag` tinyint(2) NOT NULL DEFAULT '0' COMMENT '推荐：1 首页推荐',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态：1正常,2结束',
  `create_time` int(11) NOT NULL DEFAULT '0' COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COMMENT='直播间';

-- ----------------------------
-- Records of qyc_live_room
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_live_room_rec
-- ----------------------------
DROP TABLE IF EXISTS `qyc_live_room_rec`;
CREATE TABLE `qyc_live_room_rec` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `live_id` int(11) NOT NULL DEFAULT '0' COMMENT '直播id',
  `cname` varchar(255) NOT NULL DEFAULT '' COMMENT '声网 canme 房间号',
  `token` varchar(1000) NOT NULL DEFAULT '' COMMENT '声网token',
  `url` varchar(500) NOT NULL DEFAULT '' COMMENT '录播地址',
  `sid` varchar(500) NOT NULL DEFAULT '' COMMENT '直播录制sid',
  `resourceId` varchar(1000) NOT NULL COMMENT '直播录制资源id',
  `status` tinyint(1) NOT NULL DEFAULT '3' COMMENT '状态：1 正常 2禁用 3 录制未完成',
  `start_time` int(11) NOT NULL DEFAULT '0' COMMENT '录制开始时间',
  `end_time` int(11) NOT NULL DEFAULT '0' COMMENT '录制结束时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='直播录制';

