DROP TABLE IF EXISTS `qyc_logistics_company`;
CREATE TABLE `qyc_logistics_company` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(100) DEFAULT NULL COMMENT '快递公司名称',
  `code` varchar(100) DEFAULT NULL COMMENT '快递公司编码',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `create_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `update_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

-- ----------------------------
-- Records of qyc_logistics_company
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_message
-- ----------------------------
DROP TABLE IF EXISTS `qyc_message`;
CREATE TABLE `qyc_message` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '用户ID',
  `pt_type` tinyint(2) DEFAULT '1' COMMENT '1非平台推送，2平台推送',
  `title` varchar(150) DEFAULT NULL COMMENT '标题',
  `content` text COMMENT '消息内容',
  `create_time` int(12) DEFAULT '0' COMMENT '发送时间',
  `status` int(2) DEFAULT '1' COMMENT '状态',
  `is_see` tinyint(2) DEFAULT '0' COMMENT '状态 0：未读 1：已读',
  `type` tinyint(2) DEFAULT '1' COMMENT '1系统通知，2商城通知,3酒店通知',
  `return_type` tinyint(2) DEFAULT '0' COMMENT '1商城，2酒店',
  `return_id` int(10) DEFAULT '0' COMMENT '消息关联的id',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=91 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

