-- ----------------------------
-- Table structure for qyc_message_seerecode
-- ----------------------------
DROP TABLE IF EXISTS `qyc_message_seerecode`;
CREATE TABLE `qyc_message_seerecode` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) DEFAULT NULL COMMENT '用户ID',
  `msg_id` int(12) DEFAULT '0' COMMENT '消息表id',
  `create_time` int(12) DEFAULT '0' COMMENT '发送时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='后台推送消息查看记录表';

