-- Records of qyc_message_seerecode
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_modules
-- ----------------------------
DROP TABLE IF EXISTS `qyc_modules`;
CREATE TABLE `qyc_modules` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `name` varchar(31) NOT NULL DEFAULT '' COMMENT '名称',
  `title` varchar(63) NOT NULL DEFAULT '' COMMENT '标题',
  `description` varchar(127) NOT NULL DEFAULT '' COMMENT '描述',
  `author` varchar(31) NOT NULL DEFAULT '' COMMENT '开发者',
  `icon` varchar(120) NOT NULL DEFAULT '' COMMENT '图标',
  `version` varchar(7) NOT NULL DEFAULT '' COMMENT '版本',
  `config` text NOT NULL COMMENT '配置',
  `is_system` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '是否允许卸载',
  `url` varchar(120) NOT NULL DEFAULT '' COMMENT '站点',
  `admin_manage_into` varchar(60) DEFAULT '' COMMENT '后台管理入口',
  `create_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '更新时间',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '99' COMMENT '排序，值越小越靠前',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态。0禁用，1启用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='模块功能表';

-- ----------------------------
-- Records of qyc_modules
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_nav
-- ----------------------------
DROP TABLE IF EXISTS `qyc_nav`;
CREATE TABLE `qyc_nav` (
  `id` smallint(6) unsigned NOT NULL AUTO_INCREMENT,
  `title` varchar(60) NOT NULL DEFAULT '' COMMENT '标题',
  `value` varchar(120) DEFAULT '' COMMENT 'url地址',
  `pid` smallint(6) unsigned NOT NULL DEFAULT '0' COMMENT '父级',
  `position` varchar(20) NOT NULL DEFAULT '' COMMENT '位置。头部：header，我的：my',
  `target` varchar(15) DEFAULT '_self' COMMENT '打开方式。',
  `depend_type` tinyint(1) unsigned NOT NULL DEFAULT '0' COMMENT '来源类型。0普通外链http，1模块扩展，2插件扩展，3主题扩展',
  `depend_flag` varchar(30) NOT NULL DEFAULT '' COMMENT '来源标记。如：模块或插件标识',
  `icon` varchar(120) NOT NULL DEFAULT '' COMMENT '图标',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '99' COMMENT '排序，值越小越靠前',
  `update_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '更新时间',
  `create_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '创建时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态。0禁用，1启用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='前台导航';

-- ----------------------------
-- Records of qyc_nav
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_order
-- ----------------------------
DROP TABLE IF EXISTS `qyc_order`;
CREATE TABLE `qyc_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(100) DEFAULT NULL COMMENT '订单号',
  `uid` int(11) DEFAULT '0' COMMENT '用户ID',
  `order_user` varchar(11) DEFAULT NULL COMMENT '收货人姓名',
  `order_mobile` varchar(50) DEFAULT NULL COMMENT '收货电话',
  `address` varchar(220) DEFAULT NULL COMMENT '收货地址',
  `remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `order_type` tinyint(2) DEFAULT '1' COMMENT '1商城普通订单',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '原总价',
  `coupon_id` int(10) DEFAULT '0' COMMENT '优惠券id',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券金额',
  `send_price` decimal(10,2) DEFAULT '0.00' COMMENT '运费',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付金额',
  `pay_type` tinyint(2) DEFAULT '0' COMMENT '支付方式：1支付宝，2微信，3余额',
  `create_time` int(12) DEFAULT '0' COMMENT '订单创建时间',
  `update_time` int(12) DEFAULT '0' COMMENT '更新时间',
  `pay_status` tinyint(2) DEFAULT '0' COMMENT '支付状态：0待支付，1支付成功，2支付失败',
  `pay_time` int(12) DEFAULT '0' COMMENT '支付时间',
  `screen_type` tinyint(2) DEFAULT '0' COMMENT '终端：1小程序，2pc',
  `order_status` tinyint(2) DEFAULT '0' COMMENT '订单状态：0待发货，1待收货，2已收货,3已评价,4已全部退款',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `user_status` tinyint(2) DEFAULT '1' COMMENT '用户订单状态:-1用户删除，1正常，2用户已取消',
  `close_time` int(12) DEFAULT '0' COMMENT '交易关闭时间',
  `end_time` int(12) DEFAULT '0' COMMENT '收货时间',
  `trade_no` varchar(100) DEFAULT '' COMMENT '支付宝微信交易号',
  `trade_log` mediumtext COMMENT '支付日志',
  `wuliu_code` varchar(100) DEFAULT '' COMMENT '物流公司编码',
  `wuliu_number` varchar(100) DEFAULT '' COMMENT '物流单号',
  `is_freeze` tinyint(2) DEFAULT '0' COMMENT '0没有释放冻结库存，1已释放',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of qyc_order
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_order_list
-- ----------------------------
DROP TABLE IF EXISTS `qyc_order_list`;
CREATE TABLE `qyc_order_list` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(12) DEFAULT '0' COMMENT '订单id ',
  `product_id` int(12) DEFAULT '0' COMMENT '产品id',
  `main_gg_id` int(12) DEFAULT '0' COMMENT '影响价格的规格id',
  `spec_id` varchar(255) DEFAULT '' COMMENT '规格id',
  `gg_title` varchar(250) DEFAULT '' COMMENT '规格标题',
  `info_json` text COMMENT '详情信息',
  `num` int(10) DEFAULT '0' COMMENT '购买数量',
  `old_price` decimal(10,2) DEFAULT '0.00' COMMENT '原单价',
  `new_price` decimal(10,2) DEFAULT '0.00' COMMENT '现单价',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付金额',
  `coupon_price` decimal(10,2) DEFAULT '0.00' COMMENT '优惠券金额',
  `after_status` tinyint(2) DEFAULT '0' COMMENT '售后状态：0不需售后，1售后中，2平台已同意，3平台不同意,4快递已寄出,5平台收货已处理',
  `is_comment` tinyint(2) DEFAULT '0' COMMENT '0未评价，1已评价',
  `update_time` varchar(50) DEFAULT '' COMMENT '更新日期',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of qyc_order_list
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_order_recode
-- ----------------------------
DROP TABLE IF EXISTS `qyc_order_recode`;
CREATE TABLE `qyc_order_recode` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` int(12) DEFAULT '0' COMMENT '订单id 或 退款订单id',
  `order_listid` int(10) DEFAULT '0' COMMENT '订单副表id',
  `uid` int(10) DEFAULT NULL,
  `dx_type` tinyint(2) DEFAULT '0' COMMENT '1商城，2酒店',
  `pt_type` tinyint(2) DEFAULT '1' COMMENT '1用户操作，2平台操作',
  `type` tinyint(2) DEFAULT '0' COMMENT '1发货，2确认收货，3评价,4取消订单,5申请退款,6同意退款，7拒绝退款,8用户寄回,9已打款，10取消退款,',
  `content` text COMMENT '内容',
  `create_time` int(12) DEFAULT '0' COMMENT '添加时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=73 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='订单操作记录表';

-- ----------------------------
-- Records of qyc_order_recode
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_payup_order
-- ----------------------------
DROP TABLE IF EXISTS `qyc_payup_order`;
CREATE TABLE `qyc_payup_order` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(200) DEFAULT NULL COMMENT '充值订单号',
  `uid` int(12) DEFAULT '0' COMMENT '用户id',
  `price` decimal(12,2) DEFAULT '0.00' COMMENT '充值金额',
  `pay_type` tinyint(2) DEFAULT '0' COMMENT '1支付宝充值,2微信',
  `pay_status` tinyint(2) DEFAULT '0' COMMENT '0待支付，1支付成功，2支付失败',
  `create_time` int(12) DEFAULT '0' COMMENT '充值时间',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态',
  `remark` text COMMENT '备注',
  `pay_time` int(12) DEFAULT '0' COMMENT '充值时间',
  `trade_log` text COMMENT '支付返回信息',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of qyc_payup_order
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_plugins
-- ----------------------------
DROP TABLE IF EXISTS `qyc_plugins`;
CREATE TABLE `qyc_plugins` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键',
  `name` varchar(32) NOT NULL DEFAULT '' COMMENT '插件名或标识',
  `title` varchar(32) NOT NULL DEFAULT '' COMMENT '中文名',
  `description` text NOT NULL COMMENT '插件描述',
  `config` text COMMENT '配置',
  `author` varchar(32) NOT NULL DEFAULT '' COMMENT '作者',
  `version` varchar(8) NOT NULL DEFAULT '' COMMENT '版本号',
  `admin_manage_into` varchar(60) DEFAULT '0' COMMENT '后台管理入口',
  `type` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '插件类型',
  `create_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '安装时间',
  `update_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '修改时间',
  `sort` tinyint(3) unsigned NOT NULL DEFAULT '99' COMMENT '排序，值越小越靠前',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='插件表';

-- ----------------------------
-- Records of qyc_plugins
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_product
-- ----------------------------
DROP TABLE IF EXISTS `qyc_product`;
CREATE TABLE `qyc_product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(220) DEFAULT NULL COMMENT '商品名称',
  `type1` int(10) DEFAULT '0' COMMENT '一级分类',
  `type2` int(10) DEFAULT '0' COMMENT '二级分类',
  `video_url` varchar(100) DEFAULT NULL COMMENT '视频地址',
  `show_price` decimal(10,2) DEFAULT '0.00' COMMENT '展示价格',
  `old_price` decimal(10,2) DEFAULT '0.00' COMMENT '原价',
  `imgarr` varchar(200) DEFAULT NULL COMMENT '图集',
  `flag` varchar(50) DEFAULT '' COMMENT '推荐属性：1爆款推荐，2产品推荐',
  `icon` int(12) DEFAULT NULL COMMENT '商品图片',
  `content` text COMMENT '商品详情',
  `data_json` text COMMENT '基础信息json',
  `content_img` text COMMENT '详情图片',
  `team_open` tinyint(2) DEFAULT '2' COMMENT '1开启拼团，2关闭拼团',
  `team_condition` tinyint(2) DEFAULT '0' COMMENT '2以人数达标为准',
  `team_num` int(10) DEFAULT '0' COMMENT '数量',
  `team_price` decimal(10,2) DEFAULT '0.00' COMMENT '拼团价格',
  `create_time` datetime DEFAULT NULL COMMENT '添加时间',
  `update_time` datetime DEFAULT NULL COMMENT '最后修改时间',
  `status` int(4) DEFAULT '1' COMMENT '1上架，2下架',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `sale_num` int(12) DEFAULT '0' COMMENT '真实销量',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
-- Records of qyc_product
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_producttype
-- ----------------------------
DROP TABLE IF EXISTS `qyc_producttype`;
CREATE TABLE `qyc_producttype` (
  `id` smallint(6) NOT NULL AUTO_INCREMENT,
  `title` char(20) NOT NULL DEFAULT '' COMMENT '分类名称',
  `pid` smallint(6) unsigned DEFAULT '0' COMMENT '上级id',
  `icon` varchar(50) DEFAULT '' COMMENT '图标',
  `is_tjposition` tinyint(1) NOT NULL DEFAULT '2' COMMENT '是否开启推荐位：1开启，2关闭',
  `flag` tinyint(2) DEFAULT '2' COMMENT '1首页推荐分类,2不推荐',
  `sort` smallint(6) unsigned DEFAULT '99' COMMENT '排序，值越小越靠前',
  `content` text COMMENT '内容',
  `update_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '更新时间',
  `create_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '创建时间',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '是否有效(0:无效,1:有效)',
  `level` int(5) DEFAULT '0' COMMENT '商品类别层级',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='规则表（后台菜单）';

-- ----------------------------
-- Records of qyc_producttype
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_product_guige
-- ----------------------------
DROP TABLE IF EXISTS `qyc_product_guige`;
CREATE TABLE `qyc_product_guige` (
  `id` int(12) unsigned NOT NULL AUTO_INCREMENT,
  `product_id` int(12) NOT NULL DEFAULT '0' COMMENT '商品id',
  `typeid` int(10) NOT NULL DEFAULT '0' COMMENT '规格分类ID',
  `is_price` tinyint(2) DEFAULT '0' COMMENT '0不是价格规格，1是价格规格',
  `gg_title` varchar(255) NOT NULL DEFAULT '' COMMENT '商品规格名称',
  `cben_price` decimal(10,2) DEFAULT '0.00' COMMENT '成本价格',
  `new_price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品规格价格',
  `bigdl_price` decimal(10,2) DEFAULT '0.00' COMMENT '大客户价格',
  `dls_price` decimal(10,2) DEFAULT '0.00' COMMENT '代理商价格',
  `stock` int(10) DEFAULT '0' COMMENT '库存',
  `sort` int(12) NOT NULL DEFAULT '0',
  `icon` int(12) NOT NULL DEFAULT '0' COMMENT '商品规格图片',
  `status` int(12) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of qyc_product_guige
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_rewrite
-- ----------------------------
DROP TABLE IF EXISTS `qyc_rewrite`;
CREATE TABLE `qyc_rewrite` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '主键id自增',
  `rule` varchar(255) NOT NULL DEFAULT '' COMMENT '规则',
  `url` varchar(255) NOT NULL DEFAULT '' COMMENT 'url',
  `create_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '创建时间',
  `update_time` datetime NOT NULL DEFAULT '0001-01-01 00:00:00' COMMENT '更新时间',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '状态：0禁用，1启用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='伪静态表';

-- ----------------------------
-- Records of qyc_rewrite
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_shop
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop`;
CREATE TABLE `qyc_shop` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '用户id',
  `type1` int(10) DEFAULT '0' COMMENT '商家分类id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '商家名称 ',
  `is_food` tinyint(2) DEFAULT '3' COMMENT '经营类型：1美食商家，2酒店商家，3其他商家',
  `need_order` tinyint(2) DEFAULT '2' COMMENT '是否需要预约：1需要，2不需要',
  `hotel_url` varchar(150) DEFAULT '' COMMENT '酒店链接',
  `xc_bref` varchar(200) DEFAULT '' COMMENT '宣传语',
  `address` varchar(100) NOT NULL DEFAULT '' COMMENT '地址',
  `lng_lat` varchar(100) DEFAULT '' COMMENT '经纬度',
  `mobile` varchar(50) DEFAULT '' COMMENT '电话',
  `yingye_time` varchar(100) DEFAULT '' COMMENT '营业时间（10:00-17:00）',
  `content` text COMMENT '商家介绍',
  `icon` int(12) DEFAULT '0' COMMENT '商家图片',
  `imgarr` text COMMENT '图集',
  `zhe_kou` decimal(10,2) DEFAULT '0.00' COMMENT '折扣（8折）',
  `flag` varchar(100) DEFAULT '' COMMENT '1新店尝鲜，2好店推荐，3商家大促，4本周人气',
  `views` int(12) DEFAULT '0' COMMENT '浏览量',
  `collect_num` int(12) DEFAULT '0' COMMENT '收藏数量',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家表';

