-- ----------------------------
-- Table structure for qyc_shop_apply
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_apply`;
CREATE TABLE `qyc_shop_apply` (
  `id` int(12) NOT NULL AUTO_INCREMENT,
  `uid` int(12) DEFAULT '0' COMMENT '用户id',
  `names` varchar(100) DEFAULT '' COMMENT '真实姓名',
  `tel` varchar(100) DEFAULT '' COMMENT '真实电话',
  `code_a` int(12) DEFAULT '0' COMMENT '身份证正面',
  `code_b` int(12) DEFAULT '0' COMMENT '身份证反面',
  `yyzz_img` int(12) DEFAULT '0' COMMENT '营业执照图片',
  `create_time` int(12) DEFAULT '0' COMMENT '申请时间',
  `update_time` int(12) DEFAULT '0' COMMENT '更新时间',
  `shop_id` int(10) DEFAULT '0' COMMENT '绑定商家id',
  `status` tinyint(2) DEFAULT '1' COMMENT '状态：1正常',
  `check_status` tinyint(2) DEFAULT '0' COMMENT '审核状态：0未审核，1审核成功，2审核失败',
  `check_time` int(12) DEFAULT '0' COMMENT '审核时间',
  `check_reason` varchar(200) DEFAULT '' COMMENT '审核失败原因',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家入驻申请表';

-- ----------------------------
-- Records of qyc_shop_apply
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_shop_menu
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_menu`;
CREATE TABLE `qyc_shop_menu` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的商家id',
  `type1` int(10) DEFAULT '0' COMMENT '分类id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '商家名称',
  `bref` varchar(250) DEFAULT '' COMMENT '简介',
  `icon` int(12) DEFAULT '0' COMMENT '商品图片',
  `new_price` decimal(10,2) DEFAULT '0.00' COMMENT '价格',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `sale_num` int(12) DEFAULT '0' COMMENT '销量',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家菜品';

-- ----------------------------
-- Records of qyc_shop_menu
