-- Table structure for qyc_shop_menu_type
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_menu_type`;
CREATE TABLE `qyc_shop_menu_type` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的商家id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '分类名称',
  `icon` int(12) DEFAULT '0' COMMENT '商品图片',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家菜品分类';

-- ----------------------------
-- Records of qyc_shop_menu_type
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_shop_order
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_order`;
CREATE TABLE `qyc_shop_order` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_number` varchar(100) DEFAULT '' COMMENT '订单号',
  `hexiao_code` varchar(50) DEFAULT '' COMMENT '核销码',
  `uid` int(10) DEFAULT '0' COMMENT '用户id',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的商家id',
  `order_user` varchar(100) NOT NULL DEFAULT '' COMMENT '姓名',
  `order_mobile` varchar(50) DEFAULT '' COMMENT '电话',
  `order_date` varchar(100) DEFAULT '' COMMENT '预约时间',
  `person_num` varchar(30) DEFAULT '' COMMENT '人数',
  `remark` varchar(200) DEFAULT '' COMMENT '备注',
  `order_type` tinyint(2) DEFAULT '1' COMMENT '订单类型：1订餐订单,2其他订单',
  `total_price` decimal(10,2) DEFAULT '0.00' COMMENT '总价',
  `zhe_kou` decimal(3,2) DEFAULT '0.00' COMMENT '折扣',
  `zhe_kou_price` decimal(10,2) DEFAULT '0.00' COMMENT '折后价格',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付价格',
  `hexiao_status` tinyint(2) DEFAULT '0' COMMENT '核销状态：0未核销，1已核销',
  `hexiao_time` int(12) DEFAULT '0' COMMENT '核销时间',
  `is_comment` tinyint(2) DEFAULT '0' COMMENT '0未评论，1已评论',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态:1正常,2商家端删除',
  `user_status` tinyint(2) DEFAULT '1' COMMENT '用户端状态：1正常，2删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家推荐信息列表';

-- ----------------------------
-- Records of qyc_shop_order
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_shop_order_list
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_order_list`;
CREATE TABLE `qyc_shop_order_list` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` int(12) DEFAULT '0' COMMENT '订单id',
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的商家id',
  `menu_id` int(12) NOT NULL DEFAULT '0' COMMENT '菜单id',
  `info_json` text COMMENT '商品json信息',
  `new_price` decimal(10,2) DEFAULT '0.00' COMMENT '现单价',
  `num` int(10) DEFAULT '0' COMMENT '数量',
  `pay_price` decimal(10,2) DEFAULT '0.00' COMMENT '实际支付价格',
  `update_time` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家订单商品明细表';

-- ----------------------------
-- Records of qyc_shop_order_list
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_shop_tjlist
-- ----------------------------
DROP TABLE IF EXISTS `qyc_shop_tjlist`;
CREATE TABLE `qyc_shop_tjlist` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) NOT NULL DEFAULT '0' COMMENT '关联的商家id',
  `title` varchar(100) NOT NULL DEFAULT '' COMMENT '商家名称 ',
  `icon` int(12) DEFAULT '0' COMMENT '商家图片',
  `sort` int(10) DEFAULT '0' COMMENT '排序',
  `content` text COMMENT '内容',
  `create_time` int(11) NOT NULL DEFAULT '0',
  `update_time` int(11) NOT NULL DEFAULT '0',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='商家推荐信息列表';

