-- Records of qyc_user_level
-- ----------------------------

-- ----------------------------
-- Table structure for qyc_withdrawal
-- ----------------------------
DROP TABLE IF EXISTS `qyc_withdrawal`;
CREATE TABLE `qyc_withdrawal` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `order_number` varchar(100) DEFAULT '' COMMENT '提现订单号',
  `uid` int(11) DEFAULT '0' COMMENT '用户id',
  `bank_username` varchar(100) DEFAULT '' COMMENT '银行卡姓名',
  `bank_number` varchar(100) DEFAULT NULL COMMENT '银行卡号',
  `tx_price` decimal(10,2) DEFAULT '0.00' COMMENT '提现金额',
  `create_time` int(11) DEFAULT '0' COMMENT '添加时间',
  `status` tinyint(2) DEFAULT '1' COMMENT '正常',
  `dk_status` tinyint(2) DEFAULT '1' COMMENT '1未打款，2拒绝打款，3已打款',
  `dk_time` int(12) DEFAULT '0' COMMENT '打款时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED COMMENT='提现表';

