  `address` varchar(100) NOT NULL DEFAULT '' COMMENT '地址',
  `lng_lat` varchar(100) DEFAULT '' COMMENT '经纬度',
  `content` text COMMENT '介绍',
  `colors` varchar(100) DEFAULT '' COMMENT '颜色',
